import React, { useState } from "react";

function ToDoItem(props){
    const [isCrossedOut, setCrossedOut] = useState(false);

    const handleOnClick = ()=>{
        setCrossedOut(!isCrossedOut)
    }

    return <li>props.text</li>
}

export default ToDoItem;
